// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./BytesUtils.sol";

library KeyUtils {
    function genContextKey(string memory did)
        public
        pure
        returns (string memory)
    {
        return string(abi.encodePacked(did, "@context"));
    }

    function genContextSecondKey(string memory ctx)
        public
        pure
        returns (bytes32)
    {
        return keccak256(bytes(ctx));
    }

    function genPubKeyListKey(string memory did)
        public
        pure
        returns (string memory)
    {
        return string(abi.encodePacked(did, "publicKey"));
    }

    function genPubKeyListSecondKey(bytes memory pubKey)
        public
        pure
        returns (bytes32)
    {
        return keccak256(pubKey);
    }

    function genControllerKey(string memory did)
        public
        pure
        returns (string memory)
    {
        return string(abi.encodePacked(did, "controller"));
    }

    function genControllerSecondKey(string memory controller)
        public
        pure
        returns (bytes32)
    {
        return keccak256(bytes(controller));
    }

    function genServiceKey(string memory did)
        public
        pure
        returns (string memory)
    {
        return string(abi.encodePacked(did, "service"));
    }

    function genServiceSecondKey(string memory serviceId)
        public
        pure
        returns (bytes32)
    {
        return keccak256(bytes(serviceId));
    }

    function genUpdateTimeKey(string memory did)
        public
        pure
        returns (string memory)
    {
        return string(abi.encodePacked(did, "updateTime"));
    }

    function genUpdateTimeSecondKey() public pure returns (bytes32) {
        // return keccak256("updateTime");
        return
            0xc82895c0c3ceabd782a01504a94c9aacea049cda0758a362503092064cb5015f;
    }
}
